import React from 'react';
import { Descriptions } from 'antd';
import 'antd/dist/antd.css';

const CoordinateInformation = ({name, email, address, postalCode, city})=>{
    const completeAdress = address+' '+postalCode+' '+city
    return (
        <>
    <div>{name}</div>
    <div>{completeAdress}</div>
    <div>{email}</div>
    </>

    )
}

export default CoordinateInformation;
